import Item from './Item';
import { Event } from '../models/event';

interface Props {
    events: Array<Event>;
    id: number;
    description: string;
    date: string;
    onDelete:(id: number) => void;
    searchList: Array<Event>;
}

const Events: React.FC<Props> = ({events, onDelete, searchList}) => {

    const eventList = () => {
        if(searchList.length>0) {
            {events?.map((event, index) => (
                <Item 
                    key={event.id}
                    id={event.id}
                    description={event.description}
                    date={event.date} 
                    events={[]}
                    onDelete={onDelete}        
                />  
            ))}
        } else {
            {events?.map((event, index) => (
                <Item 
                    key={event.id}
                    id={event.id}
                    description={event.description}
                    date={event.date} 
                    events={[]}
                    onDelete={onDelete}        
                />  
            ))}
        }
    }

    return (
        <>
        <h1>Event list: </h1>
        <ul>

            eventList();

        </ul>
        </>
    )
}


export default Events
